  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains the catch data from
  fishers who take marine life for commercial purposes and report their catch, effort,
  and sales on a commercial catch report form to the State of Hawaii. The fishing
  area extends from the Main Hawaiian Islands to the Northwestern Hawaiian Islands,
  with fishing also taking place on the high seas and around the Pacific Remote Island
  Areas (PRIA) and Kiribati (150o W - 179o E and 30o N - 0o N). nnThese self-reported
  forms have been collected since 1948.  In October 2002, new reporting forms were
  implemented as a result the Commercial Catch Report Revision Project, and a new
  database was developed for the data collected on these forms.n\",\n\t\"owner_org\":
